import React from 'react';


import AddEmployeeModal from './addEmployeeModal.jsx';

const ModalConductor = ({type,onHandleClose}) => {
  switch ({type}) {
    case 'ADD_EMPLOYEE':
      return <AddEmployeeModal onHandleClose = {onHandleClose} />;
    default:
      return null;
  }
};

export default ModalConductor;
